class Solution {

    /**
     * @param Integer $num1
     * @param Integer $num2
     * @return Integer
     */
    function makeTheIntegerZero($num1, $num2) {
        $operations = 0;
        while ($num1 > 0 && $operations <= 60) {
            $found = false;
            for ($i = 60; $i >= 0; $i--) {
                $value = pow(2, $i) + $num2;
                if ($num1 >= $value) {
                    $num1 -= $value;
                    $operations++;
                    $found = true;
                    break;
                }
            }
            if (!$found) return -1;
        }
        return $num1 == 0 ? $operations : -1;
    }
}
